// import 'react-slider/dist/react-slider.css';
import Slider from 'react-slider';

const MySlider = () => {
    const [value, setValue] = useState(50);
  
    const handleChange = (newValue) => {
      setValue(newValue);
    };
  
    return (
      <div>
        <Slider
          value={value}
          onChange={handleChange}
          min={0}
          max={100}
        />
        <p>Value: {value}</p>
      </div>
    );
  };
  
  export default MySlider
